import React from "react";
// import "./styles.css";

const Test = ({ list }) => {
  return (
    <div>
      {list.map((e) => (
        <p>
          {e.name}
          <span>{e.price}</span>
          <span>{e.description}</span>
        </p>
      ))}
    </div>
  );
};

export default Test;
